import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      todos: [],
    }
  }
   loadTodos() {
    fetch("http://116.203.42.55:3000/")
    .then(res => res.json())
    .then((res) => {
      console.log(res);
      this.setState({
        todos: res.list
      })
    })
  }
   componentDidMount() {
    this.loadTodos();
  }
  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
